import { logout } from "../redux/apiCall";
import { useNavigate } from "react-router-dom";
import { useDispatch } from "react-redux";




export const Handle = () => {
    const dispatch = useDispatch();
    const navigate = useNavigate();
    dispatch(logout());
    navigate("/");
    
  };

export const handleProfile = () => {
    const navigate = useNavigate();
    navigate("/user");
}
